      </div>
      <style jsx global>{`
        body {
          background-color: #203b4f;
        }
        .content {
          width: 300px;
          padding: 14px;
          font-size: 20px;
          color: #f5f5f5;
        }
        `}
      </style>
    </div>
  );
}
